import React from 'react';


function Welcome(props) {
  return (
    <h3>
      I like {props.name}.
    </h3>
  );
}

function App() {
  return (
    <div className="App">
      <Welcome name="Kim" age="99"></Welcome>
    </div>
  );
}


export default App;
